import React, { useState } from "react"

import NavBar from "./containers/NavBar/NavBar"
import styles from "./index.module.css"
import CategoryDisplay from "./containers/categoryDisplay/CategoryDisplay"
import AddCategoryCard from "./containers/addCategoryCard/AddCategoryCard"

function App() {
  const [categoryCardHidden, setCategoryCardHidden] = useState(false)

  const renderCategoryCard = () => {
    if (!categoryCardHidden) {
      return <AddCategoryCard></AddCategoryCard>
    }
  }
  return (
    <div className={styles.content}>
      <NavBar></NavBar>
      <CategoryDisplay></CategoryDisplay>
      {renderCategoryCard()}
    </div>
  )
}

export default App
